import React , {useState} from "react";
import './skill.css';
import img from '../../images/pexels-pixabay-270348.jpg'
export default function Skill(){

    const [curslide,setSlide] = useState();

    return(
        <>
        <div className="skills" id="skill">
            <h1>Skills</h1>
            <div className="container">
                <div className="left">
                    <h4>Skill :- HTML-CSS</h4>
                    <h5>Level :- Intermediate</h5>
                    <p>Check Projects <br>
                    </br>
                        <button>Check</button>
                    </p>
                </div>
                <div className="right">
                  <img src={img} alt="" />
                </div>
            </div>
        </div>
        </>
    );
}
